上海中心大厦を後にして、上海高島屋に行く。私のセーブポイント的な場所になった。

シロクマカレーを食べて、すぐ宿に帰る。

宿の中はビリヤード台があったり、すごくお洒落な内装だった。写真①

他の外国人が集まってやっていたが、全くやり方が分からないので混ざらなかった。ビリヤード覚えたい。

部屋に戻ると韓国人の女の子2人組がいた。やはり美意識が高くて、化粧品を沢山広げていた。可愛い

夜は、旅行5日目に駅で仲良くなった余さんが、本当に上海に遊びに来てくれた。

私が帰国する日まで、同じ宿に泊まることにしてくれていた。

とても明るくて楽しい子で、久本雅美みたいなキャラだった。韓国人の子と4人でめっちゃ話した。

後からわかったが、余さんは32歳で子供が2人いた。

見た目が25歳くらいで、パワフルなので本当にビックリした。

寝る前に子供と電話していてほっこりした。

しかし、余さんが元気過ぎて深夜まで大きい声で歌ったりしていたので、朝まで眠れなかった。

誤算だ。

